・ノーズクッションでスキマなしのフィット感<br />鼻とマスクの間にピッタリフィットし、スキマを大幅に減らします。<br />・メガネのくもりをカット<br /><br />ノーズクッションが鼻周辺からの呼気のモレを防ぎ、メガネのくもりを軽減します。<br />・縦横クロスプリーツ構造とノーズクッションでＷの密着効果<br /><br />鼻周辺とアゴ周辺のスキマをなくすことで、顔全体にしっかりフィット。<br />・強力ガードなのに息がラク！快適フィルター<br /><br />ガード力があって通気性の良いフィルターだから、息がしやすく快適です。<br />・0.1μｍの微粒子・花粉・ウイルス飛沫を99％カット （フィルター性能）<br /><br />特殊静電フィルターが花粉・ウイルス飛沫はもちろん、0.1μｍの微粒子もカット。<br />・肌ざわりがよい「つるさら」素材で心地よい使用感<br /><br />肌や唇が触れてもザラツキがなく、心地よい使用感です。<br />・ソフトなワイド幅耳ひも<br />幅が広く柔らかい耳ひもで、耳への負担をやわらげます。<br /><br /><br />【フィルター部捕集性能（平均値）】<br />・0.1μｍの微粒子：99％カット・・・PFE試験（0.1μｍ） カケンテストセンター<br /><br />・ウイルス飛沫：99％カット・・・VFE試験（平均約3.0μｍ） 米国・ネルソン研究所<br />・花粉：99％カット・・・花粉捕集効率試験（約30μｍ） <br />カケンテストセンター<br /><br />【対象】<br />風邪・花粉・ほこり等<br />成分<br /><br />本体・フィルタ部：ポリプロピレン、ポリエチレン<br /><br />耳ひも部：ナイロン、ポリウレタン<br />ノーズクッション：ポリエチレン<br /><br /><br />【使用上の注意】<br /><br />・本品は有害な粉塵・ガス等を防ぐ目的には使用できません。<br />・乳幼児の手の届くところに置かないでください。<br /><br />・皮フに異常がある場合や、異常があらわれた場合には使用を中止してください。<br />・着用中、臭いで気分が悪くなった場合には使用を中止してください。<br /><br />・使いきりタイプですので洗って再使用しないでください。汚れたら新しいものと交換してください。<br /><br />ノーズクッションも使いきりタイプですので、マスクからはがして再使用しないでください。<br />衛生面から1日1枚のご使用をおすすめします。<br /><br />・対象用途以外に使用しないでください。<br /><br />【開封後の注意】<br />・外箱のふたを閉めて清潔な場所に保管し、早めにご使用ください。<br /><br />・一度使用したマスクは、袋内に戻さないでください。<br />・使用後は地方自治体の区分に従って捨ててください。<br /><br />※蛍光塗料は使用していません。<br /><br /><br /><br />【お問い合わせ先】<br />白元アース株式会社　お客様相談室<br />TEL：03-5681-7691<br /><br />月曜～金曜（祝祭日を除く午前9：00～午後5：00）<br /><br /><br />JANコード：4902407580023<br />商品番号：101-50396<br /><br /><br />（　マスク・鼻フィット・メガネ・眼鏡・くもり対策・高機能・プリーツタイプ　）<br /><br />。<br /><br /><br /><br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
