・鼻とマスクの間にピッタリフィットし、スキマを大幅に減らします。<br /><br />・メガネのくもりをカット！<br /><br />　ノーズクッションが鼻周辺からの呼気のモレを防ぎ、メガネのくもりを軽減します。<br /><br /><br />・ガード力があって通気性の良いフィルターだから、息がしやすく快適です。<br /><br /><br />・特殊静電フィルターが花粉・ウイルス飛沫はもちろん、0.1μｍの微粒子もカット。<br /><br />・肌ざわりがよい「つるさら」素材で心地よい使用感！<br /><br />　肌や唇が触れてもザラツキがなく、心地よい使用感です。<br /><br />・ソフトなワイド幅耳ひも！<br />　幅が広く柔らかい耳ひもで、耳への負担をやわらげます。<br /><br /><br />・口もとに空間をつくる立体形状<br /><br /><br />〔フィルター部捕集性能(平均値)〕<br /><br />・0.1μｍの微粒子：99％カット・・・PFE試験(0.1μm)カケンテストセンター<br /><br />・ウイルス飛沫：99％カット・・・VFE試験(平均約3.0μm)米国・ネルソン研究所<br /><br />・花粉：99％カット・・・花粉捕集効率試験(約30μm)カケンテストセンター<br /><br />【用途】<br />PM2.5、花粉、インフルエンザ対策に<br /><br /><br />【注意事項】<br />＜使用上の注意＞<br />・本品は有害な粉塵・ガス等を防ぐ目的には使用できません。<br /><br />・乳幼児の手の届くところに置かないでください。<br />・皮フに異常がある場合や、異常があらわれた場合には使用を中止してください。<br /><br />・着用中、臭いで気分が悪くなった場合には使用を中止してください。<br /><br />・使いきりタイプですので洗って再使用しないでください。汚れたら新しいものと交換してください。ノーズクッションも使いきりタイプですので、マスクからはがして再使用しないでください。衛生面から1日1枚のご使用をおすすめします。<br /><br />・対象用途以外に使用しないでください。<br /><br /><br />白元アース株式会社<br />お客様相談室<br />03-5681-7691<br />【受付時間】<br /><br />月曜～金曜（祝祭日を除く午前9:00～午後5:00）<br />別途休業期間、年末年始休業期間あり<br /><br /><br />（　マスク・立体型　）<br /><br /><br /><br />JANコード：4902407580047 <br />商品番号：101-42602<br /><br /><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><br /><br /><br /><style type="text/css">
